import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
  <div className="navbar-links">
    <Link to="/">Home</Link>
    <Link to="/lessons/phishing">Lessons</Link>
    <Link to="/quizzes/phishing">Quizzes</Link>
  </div>
</nav>
  );
};

export default Navbar;
